import React, { Fragment, useState } from 'react'
import "./HomeEnd.css"
import { BsHouseFill } from "react-icons/bs";
import { MdLocationOn } from "react-icons/md";
import { Unione, Unithree, Unitwo } from './UniDetails'
const HomeEnd = ({data}) => {
    console.log(data)
    const PopSchools=[];
    data.map((value,key)=>{
        if (value.Name == "Lebanese American University"){
            PopSchools.push(value)
        }
        if (value.Name == "American University of Beirut") {
            PopSchools.push(value)
        }
        if (value.Name == "Saint Joseph University") {
            PopSchools.push(value)
        }
        
    })
    console.log(PopSchools)
    // for (let i = 0; i < data.lengthl; i++) {
    //     if (data[i].Name == "Lebanese American University") {
    //         PopSchools.push(data[i])
    //     }
    //     if (data[i].Name == "American University of Beirut") {
    //         PopSchools.push(data[i])
    //     }
    //     if (data[i].Name == "Saint Joseph University") {
    //         PopSchools.push(data[i])
    //     }
    //     console.log(data[i])
    
    // } 
    // console.log(PopSchools)
    return (
        <>
            <span className='HeadUni'>
                <h1>
                    Popular Universities
                </h1>
            </span>
            <div className='flexx'>
                <div className='card cardo'>
                    <a href='/'>
                        <div className='img'>
                            <img src={PopSchools.at} />
                        </div>
                        <h2 className='title'>{Unione.Title}</h2>
                        <div className="locnb">
                            <div className='DormNb'> <BsHouseFill style={{ width: "19px", color:"#562F4A" }} /> {Unione.DormsCount} Dorms</div>
                            <div className="loc"><MdLocationOn style={{ color: "#562F4A" }} /> Beirut</div>
                        </div>
                    </a>

                </div>

                <div className='card cardo'>
                    <a href='/'>
                        <div className='img'>
                            <img src={Unitwo.Image} />
                        </div>
                        <h2 className='title'>{Unitwo.Title}</h2>
                        <div className="locnb">

                            <div className='DormNb'> <BsHouseFill style={{ width: "19px", color: "#562F4A" }} /> {Unione.DormsCount} Dorms</div>
                            <div className="loc"><MdLocationOn style={{ color: "#562F4A" }} /> Beirut</div>
                        </div>
                    </a>
                </div>

                <div className='card cardo'>
                    <a href='/'>
                        <div className='img'>
                            <img src={Unithree.Image} />
                        </div>
                        <h2 className='title'>{Unithree.Title}</h2>
                        <div className="locnb">

                            <div className='DormNb'> <BsHouseFill style={{ width: "19px", color: "#562F4A" }} /> {Unione.DormsCount} Dorms</div>
                            <div className="loc"><MdLocationOn style={{ color: "#562F4A" }} /> Beirut</div>
                        </div>
                    </a>
                </div>

            </div>



        </>
    )
}

export default HomeEnd
